// src/modules/counter.js

// 초기 상태값
const initialState = [
  {
    id: 0,
    title: "리액트 공부하기",
    desc: "리액트 기초를 공부해봅시다",
    isDone: false,
  },
  {
    id: 1,
    title: "리액트 알아보기",
    desc: "리액트 기초를 알아봅시다",
    isDone: true,
  },
];

// 리듀서
const addTodoList = (state = initialState, action) => {
  switch (action.type) {
    default:
      return state;
  }
};

// 모듈파일에서는 리듀서를 export default 한다.
export default addTodoList;
